  \"2015-02-04T19:41:45.116203\",\n\t\"name\": \"population-health-measures-age-adjusted-mortality-rates-6a2e8\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Age-adjustment mortality rates are rates
  of deaths that are computed using a statistical method to create a metric based
  on the true death rate so that it can be compared over time for a single population
  (i.e. comparing 2006-2008 to 2010-2012), as well as enable comparisons across different
  populations with possibly different age distributions in their populations (i.e.
  comparing Hispanic residents to Asian residents).  rnAge adjustment methods applied
  to Montgomery County rates are consistent with US Centers for Disease Control and
  Prevention (CDC), National Center for Health Statistics (NCHS) as well as Maryland
  Department of Health and Mental Hygieneu2019s Vital Statistics Administration (DHMH
  VSA).rnPHS Planning and Epidemiology receives an annual data file of Montgomery
  County resident deaths registered with Maryland Department of Health and Mental
  Hygieneu2019s Vital Statistics Administration (DHMH VSA).  rnUsing SAS analytic
  software, MCDHHS standardizes, aggregates, and calculates age-adjusted rates for
  each of the leading causes of death category consistent with state and national
  methods and by subgroups based on age, gender, race, and ethnicity combinations.
  Data are released in compliance with Data Use Agreements between DHMH VSA and MCDHHS.
  This dataset will be updated Annually.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
